Defendant Phillip Lamar Bankhead in court with Attorney Michael Jude.  Kelly O'Neill appeared for the State of Wisconsin.

Matter here for plea/sentencing.  AS TO PLEA:  AS TO COUNT #1:  Defendant was advised of constitutional rights and maximum penalties, waived all rights, and plead GUILTY.  Defendant examined as to the plea.  Plea Questionnaire/Waiver of Rights, Addendum, and Jury Instructions received and filed.  Stipulation by parties to the Criminal Complaint as a factual basis to sustain the plea.  Court found the defendant guilty.  Judgment of conviction entered.
  
The Court VACATED the July 18, 2016 Jury Trial.  Sentencing proceeded.  Statements by the State, defense and defendant.  AS TO COUNT #1:  The Court sentenced the defendant to serve six (6) MONTHS in the House of Correction, STRAIGHT TIME.  The Court STAYED this sentence and placed the defendant on probation for a period of ONE (1) YEAR with the following conditions:

1) Obtain/maintain full-time employment, full-time school, or a combination of both; 
2) Perform 25 hours of community service;
3) Pay supervision fees;
4) Restitution in the amount of 752.05 to victim, Ann S.
5) If Defendant has successful probation, he can petition the Court for expungement;
6) Provide a DNA sample - pay surcharge; 
7) Pay all remaining mandatory costs, fees, surcharges and assessments by the end of probation period or balance to convert to civil judgment;

Filed,
Notice of Right to Seek Postconviction Relief.
